import Router from 'next/router'
import {Table, Button} from 'antd'
import React, {useEffect, useState} from 'react'

const TableList = ({
  list,
  setList,
  totalData,
  pageParams,
  onPage,
  onScore,
  onFail,
}) => {
  const [pageSize, setPageSize] = useState(pageParams.pageSize)

  const columns = [
    {
      title: '数据文件',
      dataIndex: 'fileName',
      key: 'fileName',
      width: 150,
    },
    {
      title: '数据类别',
      dataIndex: 'typeDesc',
      key: 'typeDesc',
      width: 150,
    },
    {
      title: '操作时间',
      dataIndex: 'createTimeStr',
      key: 'createTimeStr',
      width: 150,
    },
    {
      title: '操作员',
      dataIndex: 'createUser',
      key: 'createUser',
      width: 80,
    },
    {
      title: '状态',
      dataIndex: 'status',
      key: 'status',
      width: 100,
      render: (text) => {
        switch (text) {
          case 1:
            return '导入中'
          case 2:
            return '评分中'
          case 3:
            return '评分结束'
        }
      },
    },
    {
      title: '导入成功/失败数',
      dataIndex: 'uploadSuccNum',
      key: 'uploadSuccNum',
      width: 150,
      render: (record, row) => {
        return (
          <div>
            <p>
              {row.uploadSuccNum}/{row.uploadFailNum}
            </p>
          </div>
        )
      },
    },
    {
      title: '评分成功/失败数',
      dataIndex: 'scoreSuccNum',
      key: 'scoreSuccNum',
      width: 150,
      render: (record, row) => {
        return (
          <div>
            <p>
              {row.scoreSuccNum}/{row.scoreFailNum}
            </p>
          </div>
        )
      },
    },
    {
      title: '操作',
      dataIndex: 'cz',
      key: 'cz',
      width: 150,
      render: (text, record, index) => {
        return (
          <>
            {record.uploadFailNum === '-' ? (
              <Button type="link">
                <label style={{color: '#d7d7d7'}}>下载失败数据</label>
              </Button>
            ) : (
              <Button type="link" onClick={() => onFail(record)}>
                <a>下载失败数据</a>
              </Button>
            )}

            {record.scoreFailNum === '-' ? (
              <Button type="link" style={{color: '#d7d7d7'}}>
                重新评分
              </Button>
            ) : (
              <Button type="link" onClick={() => onScore(record)}>
                重新评分
              </Button>
            )}
          </>
        )
      },
    },
  ]

  const onShowSizeChange = (current, pageSize) => {
    console.log(current, pageSize)
    pageParams.pageSize = pageSize
    setPageSize(pageSize)
  }

  const pagination = {
    defaultCurrent: 1,
    total: totalData.total,
    pageSize: pageSize,
    showQuickJumper: true,
    showSizeChanger: true,
    onShowSizeChange: onShowSizeChange,
    current: pageParams.pageNum,
    showTotal: (total) => {
      return `共 ${total} 条记录`
    },
    onChange: (pageNumber) => {
      pageParams.pageNum = pageNumber
      onPage()
    },
  }
  const onEditStatus = (record) => {
    record.status = !record.status
    setList([...list])
  }
  return (
    <Table
      rowKey={(record) => record.id}
      dataSource={list}
      columns={columns}
      pagination={pagination}
    />
  )
}

export default TableList
